// App.js
import React from 'react';
import Card from './Components/Card';
import './App.css';


const App = () => {

  return (
    <div className="app">
      <Card
        title="Yellow Mac"
       imageUrl="https://images.pexels.com/photos/2317904/pexels-photo-2317904.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2"
        buttonText="Show More"
      />
       <Card
        title="Spring Flowers"
       imageUrl="https://images.pexels.com/photos/326900/pexels-photo-326900.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2"
        buttonText="Show More"
      />
       <Card
        title="Spring Flowers"
       imageUrl="https://images.pexels.com/photos/12715260/pexels-photo-12715260.jpeg"
        buttonText="Show More"
      />
       <Card
        title="Spring Flowers"
       imageUrl="https://images.pexels.com/photos/1661179/pexels-photo-1661179.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2"
        buttonText="Show More"
      />


    </div>
  ); 
};

export default App;
